import React from "react";
import styled from "styled-components";

const HeaderWrap = styled.div`
  display: flex;
  align-items: space-between;
`;

const Bar = styled.div``;

const Search = styled.div``;

const Logo = styled.h1`
  color: #4b8aff;
  font-size: 25px;
  font-weight: 700;
`;

const Header = () => {
  return (
    <HeaderWrap>
      <Bar />
      <Logo>Siders</Logo>
      <Search />
    </HeaderWrap>
  );
};

export default Header;
